import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  standalone: true,
  template: `
    <div class="container">
      <h1>Welcome to IHK Trainer</h1>
      <p>Start building your Angular application here</p>
    </div>
  `,
  styles: [`
    .container {
      padding: 2rem;
      text-align: center;
    }

    h1 {
      color: #0066cc;
      margin-bottom: 1rem;
    }

    p {
      color: #666;
    }
  `]
})
export class AppComponent {
  title = 'IHK Trainer';
}
